import "./App.css";
import Shop from "./componants/Shop/Shop";
import Banner from "./componants/Banner/Banner";
import Footer from "./componants/Footer/Footer";
import Navbar from "./componants/Navbar/Navbar";

import { BrowserRouter as Root, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Navbar />
      <Banner />
      <Footer />
      <button>about</button>
      <button>shop</button>
      <Root>
        <Route component={Shop}/>


      </Root>
    </div>
  );
}

export default App;
